VW Golf7/Golf7 Variant、Audi A3/S3(8V)、TT(Mk3)といった最新のVW/AUDI車に装着出来るステンレス製フットレストカバーです。純正と見間違えるデザインと最高のクオリティを併せ持ちつつ、フットレストとしての機能も優れています。取り付けは付属のネジ3本による純正フットレストカバーへのネジ止め固定です。固定ネジを見えないように工夫されている点も魅力的です。AT車だけでなくMT車にも装着可能です。<br><br>●ステンレス製フットレストカバー●AT車・MT車取り付け可●カラー：ポリッシュシルバー/ブラック●材質：ステンレス/ラバー(滑り止め)●取付方法：付属のネジによる純正フットレストカバーへのネジ止め固定<br><br><br><br>適合車種：VW Golf7/AUDI A3/S3(8V)<br><br><br><br>インテリア | インテリアその他<BR>※こちらの商品は代引き不可です<tr><td colspan="2">
